CREATE TABLE alliances (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    name TEXT NOT NULL,
    master_name TEXT NOT NULL,
    member_count INTEGER DEFAULT 0,
    guild_level INTEGER DEFAULT 1,
    emblem TEXT,
    description TEXT,
    is_main INTEGER DEFAULT 0,
    sort_order INTEGER DEFAULT 0,
    created_at TEXT DEFAULT (datetime('now'))
);

PRAGMA defer_foreign_keys=TRUE;
CREATE TABLE users (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    username TEXT UNIQUE NOT NULL,
    password_hash TEXT NOT NULL,
    character_name TEXT NOT NULL,
    job TEXT,
    level INTEGER DEFAULT 100,
    discord TEXT,
    profile_image TEXT,
    role TEXT DEFAULT 'member',
    alliance_id INTEGER,
    is_approved INTEGER DEFAULT 0,
    is_online INTEGER DEFAULT 0,
    last_login_at TEXT,
    created_at TEXT DEFAULT (datetime('now')),
    updated_at TEXT DEFAULT (datetime('now')), default_icon TEXT, profile_zoom TEXT DEFAULT '1',
    FOREIGN KEY (alliance_id) REFERENCES alliances(id)
);
CREATE TABLE board_categories (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    slug TEXT UNIQUE NOT NULL,
    name TEXT NOT NULL,
    description TEXT,
    created_at TEXT DEFAULT (datetime('now'))
);
CREATE TABLE posts (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    category_id INTEGER NOT NULL,
    user_id INTEGER NOT NULL,
    title TEXT NOT NULL,
    content TEXT NOT NULL,
    view_count INTEGER DEFAULT 0,
    like_count INTEGER DEFAULT 0,
    comment_count INTEGER DEFAULT 0,
    is_notice INTEGER DEFAULT 0,
    is_deleted INTEGER DEFAULT 0,
    created_at TEXT DEFAULT (datetime('now')),
    updated_at TEXT DEFAULT (datetime('now')),
    FOREIGN KEY (category_id) REFERENCES board_categories(id),
    FOREIGN KEY (user_id) REFERENCES users(id)
);
CREATE TABLE post_images (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    post_id INTEGER NOT NULL,
    image_key TEXT NOT NULL,
    image_url TEXT NOT NULL,
    sort_order INTEGER DEFAULT 0,
    created_at TEXT DEFAULT (datetime('now')),
    FOREIGN KEY (post_id) REFERENCES posts(id) ON DELETE CASCADE
);
CREATE TABLE comments (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    post_id INTEGER NOT NULL,
    user_id INTEGER NOT NULL,
    parent_id INTEGER,
    content TEXT NOT NULL,
    is_deleted INTEGER DEFAULT 0,
    created_at TEXT DEFAULT (datetime('now')),
    updated_at TEXT DEFAULT (datetime('now')),
    FOREIGN KEY (post_id) REFERENCES posts(id) ON DELETE CASCADE,
    FOREIGN KEY (user_id) REFERENCES users(id),
    FOREIGN KEY (parent_id) REFERENCES comments(id)
);
CREATE TABLE post_likes (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    post_id INTEGER NOT NULL,
    user_id INTEGER NOT NULL,
    created_at TEXT DEFAULT (datetime('now')),
    FOREIGN KEY (post_id) REFERENCES posts(id) ON DELETE CASCADE,
    FOREIGN KEY (user_id) REFERENCES users(id),
    UNIQUE(post_id, user_id)
);
CREATE TABLE gallery (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    user_id INTEGER NOT NULL,
    title TEXT NOT NULL,
    description TEXT,
    image_key TEXT NOT NULL,
    image_url TEXT NOT NULL,
    thumbnail_key TEXT,
    thumbnail_url TEXT,
    view_count INTEGER DEFAULT 0,
    like_count INTEGER DEFAULT 0,
    is_deleted INTEGER DEFAULT 0,
    created_at TEXT DEFAULT (datetime('now')),
    updated_at TEXT DEFAULT (datetime('now')),
    FOREIGN KEY (user_id) REFERENCES users(id)
);
CREATE TABLE gallery_likes (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    gallery_id INTEGER NOT NULL,
    user_id INTEGER NOT NULL,
    created_at TEXT DEFAULT (datetime('now')),
    FOREIGN KEY (gallery_id) REFERENCES gallery(id) ON DELETE CASCADE,
    FOREIGN KEY (user_id) REFERENCES users(id),
    UNIQUE(gallery_id, user_id)
);
CREATE TABLE attendance (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    user_id INTEGER NOT NULL,
    check_date TEXT NOT NULL,
    check_time TEXT DEFAULT (datetime('now')),
    streak_count INTEGER DEFAULT 1,
    FOREIGN KEY (user_id) REFERENCES users(id),
    UNIQUE(user_id, check_date)
);
CREATE TABLE attendance_stats (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    user_id INTEGER NOT NULL UNIQUE,
    total_checks INTEGER DEFAULT 0,
    current_streak INTEGER DEFAULT 0,
    max_streak INTEGER DEFAULT 0,
    last_check_date TEXT,
    FOREIGN KEY (user_id) REFERENCES users(id)
);
CREATE TABLE attendance_benefits (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    year INTEGER NOT NULL,
    month INTEGER NOT NULL,
    reward_5 TEXT,
    reward_10 TEXT,
    reward_15 TEXT,
    reward_20 TEXT,
    reward_full TEXT,
    created_at TEXT DEFAULT (datetime('now')),
    updated_at TEXT DEFAULT (datetime('now')),
    UNIQUE(year, month)
);

CREATE TABLE events (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    title TEXT NOT NULL,
    description TEXT,
    event_type TEXT NOT NULL,
    event_date TEXT NOT NULL,
    event_time TEXT NOT NULL,
    max_participants INTEGER,
    current_participants INTEGER DEFAULT 0,
    is_active INTEGER DEFAULT 1,
    created_by INTEGER,
    created_at TEXT DEFAULT (datetime('now')), updated_at TEXT,
    FOREIGN KEY (created_by) REFERENCES users(id)
);
CREATE TABLE event_participants (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    event_id INTEGER NOT NULL,
    user_id INTEGER NOT NULL,
    status TEXT DEFAULT 'pending',
    created_at TEXT DEFAULT (datetime('now')),
    FOREIGN KEY (event_id) REFERENCES events(id) ON DELETE CASCADE,
    FOREIGN KEY (user_id) REFERENCES users(id),
    UNIQUE(event_id, user_id)
);
CREATE TABLE notices (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    user_id INTEGER,
    title TEXT NOT NULL,
    content TEXT,
    tag TEXT DEFAULT 'Í≥µÏßÄ',
    is_important INTEGER DEFAULT 0,
    is_active INTEGER DEFAULT 1,
    created_at TEXT DEFAULT (datetime('now')),
    updated_at TEXT DEFAULT (datetime('now')), is_hot INTEGER DEFAULT 0, created_by INTEGER,
    FOREIGN KEY (user_id) REFERENCES users(id)
);
CREATE TABLE game_scores (id INTEGER PRIMARY KEY AUTOINCREMENT, user_id INTEGER NOT NULL, game_type TEXT NOT NULL, score INTEGER NOT NULL, metadata TEXT DEFAULT '{}', created_at TEXT DEFAULT (datetime('now')), updated_at TEXT DEFAULT (datetime('now')), FOREIGN KEY (user_id) REFERENCES users(id), UNIQUE(user_id, game_type));
CREATE TABLE scroll_records (id INTEGER PRIMARY KEY AUTOINCREMENT, user_id INTEGER NOT NULL, item_id INTEGER NOT NULL, item_name TEXT NOT NULL, success_count INTEGER NOT NULL DEFAULT 0, fail_count INTEGER NOT NULL DEFAULT 0, total_stat INTEGER NOT NULL DEFAULT 0, stat_type TEXT DEFAULT 'atk', created_at TEXT DEFAULT (datetime('now')), FOREIGN KEY (user_id) REFERENCES users(id));
CREATE TABLE incubator_items (
    id INTEGER PRIMARY KEY,
    name TEXT NOT NULL,
    rate REAL NOT NULL,
    type TEXT NOT NULL,
    percent INTEGER
);
CREATE TABLE incubator_inventory (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    user_id INTEGER NOT NULL,
    item_id INTEGER NOT NULL,
    count INTEGER DEFAULT 1,
    created_at TEXT DEFAULT (datetime('now')),
    updated_at TEXT DEFAULT (datetime('now')),
    FOREIGN KEY (user_id) REFERENCES users(id),
    FOREIGN KEY (item_id) REFERENCES incubator_items(id),
    UNIQUE(user_id, item_id)
);
CREATE TABLE incubator_history (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    user_id INTEGER NOT NULL,
    item_id INTEGER NOT NULL,
    hatch_count INTEGER DEFAULT 1,
    created_at TEXT DEFAULT (datetime('now')),
    FOREIGN KEY (user_id) REFERENCES users(id),
    FOREIGN KEY (item_id) REFERENCES incubator_items(id)
);
CREATE TABLE incubator_daily_stats (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    user_id INTEGER NOT NULL,
    hatch_date TEXT NOT NULL,
    total_hatches INTEGER DEFAULT 0,
    legendary_count INTEGER DEFAULT 0,
    FOREIGN KEY (user_id) REFERENCES users(id),
    UNIQUE(user_id, hatch_date)
);
CREATE TABLE incubator_bonus (user_id INTEGER PRIMARY KEY, bonus_hatches INTEGER DEFAULT 0, updated_at TEXT DEFAULT (datetime('now')), FOREIGN KEY (user_id) REFERENCES users(id));
CREATE TABLE chaos_records (id INTEGER PRIMARY KEY AUTOINCREMENT, user_id INTEGER NOT NULL, atk INTEGER DEFAULT 0, matk INTEGER DEFAULT 0, total_stat INTEGER DEFAULT 0, innocent_used INTEGER DEFAULT 0, chaos_success INTEGER DEFAULT 0, chaos_fail INTEGER DEFAULT 0, created_at DATETIME DEFAULT CURRENT_TIMESTAMP, str INTEGER DEFAULT 0, dex INTEGER DEFAULT 0, int INTEGER DEFAULT 0, luk INTEGER DEFAULT 0, upgrade_count INTEGER DEFAULT 5, FOREIGN KEY (user_id) REFERENCES users(id));
CREATE TABLE competition_glove_records (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  user_id INTEGER NOT NULL,
  final_attack INTEGER NOT NULL DEFAULT 0,
  upgrade_count INTEGER NOT NULL DEFAULT 0,
  scroll_10_used INTEGER NOT NULL DEFAULT 0,
  scroll_60_used INTEGER NOT NULL DEFAULT 0,
  scroll_100_used INTEGER NOT NULL DEFAULT 0,
  created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
  FOREIGN KEY (user_id) REFERENCES users(id) ON DELETE CASCADE
);
CREATE TABLE competition_chaos_records (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  user_id INTEGER NOT NULL,
  atk INTEGER NOT NULL DEFAULT 0,
  matk INTEGER NOT NULL DEFAULT 0,
  str INTEGER NOT NULL DEFAULT 0,
  dex INTEGER NOT NULL DEFAULT 0,
  int INTEGER NOT NULL DEFAULT 0,
  luk INTEGER NOT NULL DEFAULT 0,
  total_stat INTEGER NOT NULL DEFAULT 0,
  upgrade_count INTEGER NOT NULL DEFAULT 0,
  chaos_used INTEGER NOT NULL DEFAULT 0,
  innocent_used INTEGER NOT NULL DEFAULT 0,
  white_used INTEGER NOT NULL DEFAULT 0,
  created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
  FOREIGN KEY (user_id) REFERENCES users(id) ON DELETE CASCADE
);
DELETE FROM sqlite_sequence;
CREATE INDEX idx_users_username ON users(username);
CREATE INDEX idx_users_character_name ON users(character_name);
CREATE INDEX idx_posts_category ON posts(category_id, is_deleted, created_at DESC);
CREATE INDEX idx_posts_user ON posts(user_id);
CREATE INDEX idx_comments_post ON comments(post_id, is_deleted);
CREATE INDEX idx_gallery_user ON gallery(user_id, is_deleted);
CREATE INDEX idx_attendance_user_date ON attendance(user_id, check_date);
CREATE INDEX idx_events_date ON events(event_date, is_active);
CREATE INDEX idx_game_scores_type ON game_scores(game_type, score);
CREATE INDEX idx_game_scores_user ON game_scores(user_id);
CREATE INDEX idx_scroll_records_user ON scroll_records(user_id);
CREATE INDEX idx_scroll_records_stat ON scroll_records(total_stat DESC);
CREATE INDEX idx_incubator_inventory_user ON incubator_inventory(user_id);
CREATE INDEX idx_incubator_history_user ON incubator_history(user_id, created_at DESC);
CREATE INDEX idx_incubator_daily_stats_user_date ON incubator_daily_stats(user_id, hatch_date);
CREATE INDEX idx_competition_glove_attack ON competition_glove_records(final_attack DESC);
CREATE INDEX idx_competition_glove_user ON competition_glove_records(user_id);
CREATE INDEX idx_competition_chaos_total ON competition_chaos_records(total_stat DESC);
CREATE INDEX idx_competition_chaos_user ON competition_chaos_records(user_id);
